    return (
        <Router>
            <div className="container">

                <div className="row ">
                    <div className="col-sm mt-5" style={{ fontSize: '30px' }}>
                        ข้อมูลของฉัน
                    </div>

                    <div className='col-2 mt-3'>
                        <Avatar  src='https://www.woolha.com/media/2020/03/eevee.png' variant="square" />

                    </div>

                    <div className='col-2 mt-5' style={{ fontSize: '20px' }}>
                        ไปยังบัญชีผู้ใช้
                    </div>

                    <div className="box" >
                        
                    </div>

                </div>
            </div>
        </Router>

    );
}
